const entrada = items[0].json;

// Reestruturando os campos para seguir o modelo anterior
const profile = {
  profile_id: entrada.profile_id,
  fullname: entrada.nome,
  sexo: entrada.sexo,
  idade_aproximada: entrada.idade_aproximada,
  location: entrada.cidade + ', ' + entrada.pais,
  company: entrada.empresa_atual,
  headline: entrada.cargo_atual,
  sobre: entrada.sobre || '',
  linkedin_url: entrada.linkedin_url
};

// Mapeando experiências
const experiences = (entrada.experiencias || []).map(exp => ({
  title: exp.titulo,
  company: exp.empresa,
  start_date: exp.inicio,
  end_date: exp.fim,
  description: exp.descricao
}));

// Mapeando educação
const education = (entrada.educacoes || []).map(edu => ({
  school: edu.instituicao,
  degree: edu.curso,
  field: edu.area,
  start_date: edu.inicio,
  end_date: edu.fim
}));

// Mapeando idiomas
const languages = (entrada.idiomas || []).map(lang => ({
  language: lang.idioma,
  proficiency: lang.proficiencia
}));

// Mapeando logs de processamento (metadata)
const processing_log = Object.entries(entrada.metadata || {}).map(([step, data]) => ({
  step,
  ...data
}));

return [{
  json: {
    profile,
    experiences,
    education,
    languages,
    processing_log
  }
}];

// Pega todos os itens JSON retornados do node anterior (enriquecimento via API)
const enrichmentData = $input.all().map(item => item.json);

// Dados do node atual (node "Code"): perfil consolidado
const profile = $('Code').item.json.profile;
const languages = $('Code').item.json.languages || [];
const experiences = $('Code').item.json.experiences || [];
const education = $('Code').item.json.education || [];

// Funções auxiliares para localizar os blocos desejados
const findBlock = (key) => enrichmentData.find(entry => Object.keys(entry?.Result?.[0] || {}).includes(key))?.Result?.[0];

// Blocos específicos
const indebtedBlock = findBlock("IndebtednessQuestion");
const collectionsBlock = findBlock("Collections");
const bettingBlock = findBlock("OnlineBettingPropensity");
const vehiclesBlock = findBlock("Vehicles");

// Acessos seguros aos dados
const indebted = indebtedBlock?.IndebtednessQuestion?.LikelyInDebt;
const isNegative = collectionsBlock?.Collections?.IsCurrentlyOnCollection;
const lastDebtDate = collectionsBlock?.Collections?.LastCollectionDate;
const debtMonths = collectionsBlock?.Collections?.TotalCollectionMonths;
const bettingScore = bettingBlock?.OnlineBettingPropensity?.PropensityScore;
const vehiclesCount = (vehiclesBlock?.Vehicles || []).length;

// Interpretar a propensão a apostas (A = maior, H = quase nula)
const bettingMap = {
  'A': 'Muito Alta',
  'B': 'Alta',
  'C': 'Moderada-alta',
  'D': 'Moderada',
  'E': 'Moderada-baixa',
  'F': 'Baixa',
  'G': 'Muito Baixa',
  'H': 'Quase nula'
};
const bettingRisk = bettingMap[bettingScore] || `Desconhecida${bettingScore ? ` (retorno '${bettingScore}')` : ''}`;

// Montar o prompt
const prompt = `
Analise o seguinte perfil profissional:

Nome completo: ${profile.fullname}
Cargo atual: ${profile.headline}
Empresa atual: ${profile.company}
Localização: ${profile.location}

Idiomas declarados:
${languages.map(lang => `${lang.language} (${lang.proficiency})`).join(', ')}

Experiências profissionais:
${experiences.map(exp => `- ${exp.title} na ${exp.company} de ${exp.start_date_month}/${exp.start_date_year} até ${exp.end_date_month || 'atual'}/${exp.end_date_year || ''}`).join('\n')}

Formação acadêmica:
${education.map(edu => `- ${edu.degree} em ${edu.school}`).join('\n')}

Dados adicionais de enriquecimento:

- Indicação de endividamento provável: ${indebted === true ? 'Sim' : 'Não'}
- Está negativado atualmente: ${isNegative === true ? 'Sim' : 'Não'}
- Última data de cobrança registrada: ${lastDebtDate || 'Não encontrada'}
- Meses com histórico de cobrança: ${debtMonths || 0}
- Propensão a apostas online: ${bettingRisk}
- Quantidade de veículos registrados: ${vehiclesCount}

Com base nesses dados, forneça uma análise sobre o perfil profissional, risco financeiro e comportamento geral do indivíduo.
`.trim();

// Retorno
return [{ json: { prompt } }];

