const profile = {
  profile_id: null,
  nome: null,
  sexo: null,
  idade_aproximada: null,
  cidade: null,
  pais: null,
  empresa_atual: null,
  cargo_atual: null,
  experiencias: [],
  educacoes: [],
  certificacoes: [],
  idiomas: [],
  metadata: {},
  sobre: null,
  linkedin_url: null
};

for (const item of items) {
  const data = item.json;

  if (data.profile_id && profile.profile_id === null) {
    profile.profile_id = data.profile_id;
  }

  // Perfil principal
  if (data.fullname) {
    profile.nome = data.fullname;
    profile.linkedin_url = data.linkedin_url || null;
    profile.cidade = data.location_city || null;
    profile.pais = data.location_country || null;
    profile.empresa_atual = data.current_company || null;
    profile.cargo_atual = data.designation || null;
    profile.sobre = data.about || null;
  }

  // Experiências
  if (data.title && data.company) {
    profile.experiencias.push({
      titulo: data.title,
      empresa: data.company,
      inicio: `${data.start_date_month || "?"} ${data.start_date_year || "?"}`,
      fim: data.is_current ? "Presente" : `${data.end_date_month || "?"} ${data.end_date_year || "?"}`,
      descricao: data.description || null
    });
  }

  // Educação
  if (data.degree || data.school) {
    profile.educacoes.push({
      instituicao: data.school || null,
      curso: data.degree || data.degree_name || null,
      area: data.field_of_study || null,
      inicio: `${data.start_date_month || "?"} ${data.start_date_year || "?"}`,
      fim: `${data.end_date_month || "?"} ${data.end_date_year || "?"}`
    });
  }

  // Certificações
  if (data.name && data.issuer) {
    profile.certificacoes.push({
      nome: data.name,
      emissor: data.issuer,
      data_emissao: data.issued_date || null
    });
  }

  // Idiomas
  if (data.language && data.proficiency) {
    profile.idiomas.push({
      idioma: data.language,
      proficiencia: data.proficiency
    });
  }

  // Logs e status
  if (data.step && data.status) {
    profile.metadata[data.step] = {
      status: data.status,
      mensagem: data.message || null,
      data: data.created_at || null
    };
  }
}

return [{ json: profile }];

